Feather Care
Storage: Keep hanging and dry in the shadow;Avoid long time direct sunlight.

Cleaning: 
1.Gentlely washing according to feather lines,could use shampoo if need;
 2.Absorb the water from the feather by towel;
 3.Airing dry in the shadow or with cold wind blower.

